'use strict';


function loadSqlJsLibrary(callback) {
    const script = document.createElement('script');
    script.src = "/js/libs/sql-wasm.js";
    script.onload = callback;
    document.head.appendChild(script);
}

const base64Database = '';


let db;

// Function to convert base64 to Uint8Array
function base64ToUint8Array(base64) {
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }
    return bytes;
}

// Initialize the database after the library is loaded
loadSqlJsLibrary(() => {
    initSqlJs({
        locateFile: file => `/js/libs/${file}` // Ensure this path is correct
    }).then(function(SQL) {
        // Convert base64 to Uint8Array
        const dbData = base64ToUint8Array(base64Database);

        // Load the existing database
        db = new SQL.Database(dbData);

        // Query the data
        const result = db.exec("SELECT * FROM Items");

        // Log the result
    });
});

export function Print_Icon(uID) {
    if (!db) {
        console.error("Database is not initialized.");
        return;
    }

    const sql = `SELECT * FROM Items WHERE uID = ?`;
    const stmt = db.prepare(sql);
    stmt.bind([uID]);
    
    const result = [];
    while (stmt.step()) {
        result.push(stmt.getAsObject());
    }
    stmt.free();

}

